import React from 'react';
import {
  Container,
  List,
  ListItem,
  ListItemText
  } from '@material-ui/core';

import { privacyData } from '../data';
import { Status } from './Styles';

function PrivacyContainer(){
  return(
    <Container>
      <Status>{privacyData.length} trackers detected</Status>
      <List className="LKOlist">
      {privacyData.map((item) => (
        <ListItem className="LKOlistitem" key={item.id}>
          <ListItemText primary={item.type} secondary={`${item.name} ${item.description}`}/>
        </ListItem>
      ))}
      </List>
    </Container>
  );
};

export default PrivacyContainer;
